import React from "react";
import Nav from 'react-bootstrap/Nav';

function NavBar() {
  return (
    <Nav justify variant="tabs" defaultActiveKey="/home">
      <Nav.Item>
        <Nav.Link href="/search" style={styles.link}>Search</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/saved" style={styles.link}>Saved</Nav.Link>
      </Nav.Item>

    </Nav>
  );
}

export default NavBar;

const styles = {
  link: {
    color: "#135d66",
    backgroundColor: "#38A9C8",
    padding: "10px",
  }
}
